import { ButtonProduct } from "../../styles/Buttons";
import { chooseIcon } from "../functions/getIcon";

export const MenuButton = (inPress: any) => {
  return (
    <ButtonProduct
      theme={{ size: "35px", sqr: true }}
      onClick={() => inPress()}
    >
      {chooseIcon("menu", "true")}
    </ButtonProduct>
  );
};
